My directorial debut! “DAYTRIPPER” out April 23. Swipe for trailer ➡️
-
“DAYTRIPPER” is a modern silent film that tells the story of two men meeting and falling in love in Fire Island Pines.

Created by choreographer and @abtofficial principal dancer @jamesbwhiteside alongside filmmaker @kylie.ju, #Daytripper follows performers @jake.tribus and @lloydknight through time as they fall in love in dance.

Watch it as part of @allartstv’s #ArtistInResidence series April 23 at 10:55 p.m. EST. Find more information at the link in bio!

